import React from 'react';
import ReactDOM from 'react-dom';
import { Route, Link } from 'react-router-dom';
import {withRouter} from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import home from '../home/home';
import SentenceGenerator from '../SentenceGenerator/SentenceGenerator';
import SentenceResults from '../SentenceResults/SentenceResults';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <h1>Rachel Perez Portfolio</h1>
      <nav class="navbar">
      <div class="hamburger">&#9776;</div> 
       <ul class="menu">
          <li>Home</li>
          <li>Portfolio</li>
          <li>About Me</li>
          <li>Contact Me</li>
        </ul> 
    </nav>
    </header>
    <main>
      <Route 
        exact path='/' 
        component={LandingPage} 
      />
      <Route 
        exact path='/sentence-generator' 
        component={SentenceGenerator} 
      /> 
      <Route 
        exact path='/sentence-results' 
        component={SentenceGenerator} 
      /> 
      </main>
    </div>
  );
}

export default App;
